import React from 'react';
import {View,Text} from 'react-native'
import { Avatar, Button, Card, Title, Paragraph } from "react-native-paper";
export default class AvailableTutors extends React.Component{
    componentDidMount() {
        
    }

    renderItem = ({ item, index }) => {
        let createDate = new Date(item.uploadTime.seconds * 1000);
    
        return (
          <Card style={styles.card}>
            <Card.Content>
              <Title>Quiz {index + 1} </Title>
              <Paragraph>
                Uploaded: {createDate.toLocaleTimeString()},{" "}
                {createDate.toDateString()}{" "}
              </Paragraph>
              {/* <Paragraph>Time & Date</Paragraph> */}
            </Card.Content>
            {/* <Card.Cover source={{ uri: "https://picsum.photos/700" }} /> */}
            <Card.Actions>
              <Button onPress={this.downloadPDF}>DOWNLOAD</Button>
            </Card.Actions>
          </Card>
        );
      };
    
    render(){
        return(
            <View>
  <Card style={styles.card}>
        <Card.Content>
          <Title>Tutor {index + 1} </Title>
          <Paragraph>
            Available Tutor List:
          </Paragraph>
          {/* <Paragraph>Time & Date</Paragraph> */}
        </Card.Content>
        {/* <Card.Cover source={{ uri: "https://picsum.photos/700" }} /> */}
        {/* <Card.Actions>
          <Button onPress={this.downloadPDF}>DOWNLOAD</Button>
        </Card.Actions> */}
      </Card>          
        </View>
        )
    }
}
